     def calculateMinimumHP(self, dungeon):
         """
         :type dungeon: List[List[int]]
         :rtype: int
         """
         m = len(dungeon)
         n = len(dungeon[0])
         dp = [[0 for _ in range(n)] for _ in range(m)]
         dp[-1][-1] = max(1, 1 - dungeon[-1][-1])
         for i in range(m-2, -1, -1):
             dp[i][-1] = max(1, dp[i+1][-1] - dungeon[i][-1])
