        self.id = None
        self.time = 0.0
        self.prev = None
        self.next = None

    def __eq__(self, other):
        return self.x == other.x and self.y == other.y and self.vx == other.vx and self.vy == other.vy and self.r == other.r

    def __hash__(self):
        return hash((self.x, self.y, self.vx, self.vy, self.r))

    def __str__(self):
        return "Droplet(x=%f, y=%f, vx=%f, vy=%f, r=%f, area=%f, radius=%f, color=%s, id=%s, time=%f, prev=%s, next=%s)" % (self.x, self.y, self.vx, self.vy, self.r, self.area, self.radius, self.color, self.id, self.time, self.prev, self.next)

    def __repr__(self):
        return str(self)

    def __lt__(self, other):
        return self.time < other.time

    def __le__(self, other):
        return self.time <= other.time

    def __gt__(self, other):
        return self.time > other.time

    def __ge__(self, other):
        return self.time >= other.time

    def __add__(self, other):
        return Droplet(self.x + other.x, self.y + other.y, self.vx + other.vx, self.vy + other.vy, self.r + other.r)

    def __sub__(self, other):
        return Droplet(self.x - other.x, self.y - other.y, self.vx - other.vx, self.vy - other.vy, self.r - other.r)

    def __mul__(self, other):
        return Droplet(self.x * other, self.y * other, self.vx * other, self.vy * other, self.r * other)

    def __truediv__(self, other):
        return Droplet(self.x / other, self.y / other, self.vx / other, self.vy / other, self.r / other)

    def __floordiv__(self, other):
        return Droplet(self.x // other, self.y // other, self.vx // other, self.vy // other, self.r // other)

    def __mod__(self, other):
        return Droplet(self.x % other, self.y % other, self.vx % other, self.vy % other, self.r % other)

    def __pow__(self, other):
        return Droplet(self.x ** other, self.y ** other, self.vx ** other, self.vy ** other, self.r ** other)

    def __neg__(self):
        return Droplet(-self.x, -self.y, -self.vx, -self.vy, -self.r)

    def __pos__(self):
        return Droplet(self.x, self.y, self.vx, self.vy, self.r)

    def __abs__(self):
        return Droplet(abs(self.x), abs(self.y), abs(self.vx), abs(self.vy), abs(self.r))

