class Solution:
     def majorityElement(self, nums):
         """
         :type nums: List[int]
         :rtype: List[int]
         """
         if not nums:
             return []
         count1 = 0
         count2 = 0
         candidate1 = None
         candidate2 = None
         for num in nums:
             if count1 == 0 and candidate2 != num:
                 candidate1 = num
                 count1 += 1
             elif count2 == 0 and candidate1 != num:
                 candidate2 = num
                 count2 += 1
             elif candidate1 == num:
                 count1 += 1
             elif candidate2 == num:
                 count2 += 1
             else:
                 count1 -= 1
                 count2 -= 1
         return [num for num in [candidate1, candidate2] if nums.count(num) > len(nums) // 3]

