  return True
 if n%2==0:
  return False
 for i in range(3,int(math.sqrt(n))+1,2):
  if n%i==0:
   return False
 return True
def primefactors(n):
 factors=[]
 while n%2==0:
  factors.append(2)
  n=n//2
 for i in range(3,int(math.sqrt(n))+1,2):
  while n%i==0:
   factors.append(i)
   n=n//i
 if n>2:
  factors.append(n)
 return factors
def gcd(a,b):
 if a==0:
  return b
 return gcd(b%a,a)
def lcm(a,b):
 return (a*b)//gcd(a,b)
def solve(n):
 for i in range(2,n):
  if isprime(i):
   factors=primefactors(i)
   for j in factors:
    if lcm(j,n)==n:
     return i
