t = int(input())
for _ in range(t):
    n = int(input())
    a = list(map(int, input().split()))
    a.sort()
    ans = 0
    for i in range(n):
        if a[i] % 3 == 0:
            ans += 1
    for i in range(n):
        if a[i] % 3 == 1:
            for j in range(i, n):
                if a[j] % 3 == 2:
                    a[i], a[j] = a[j], a[i]
                    ans += 1
                    ans -= 1
                    break
    for i in range(n):
        if a[i] % 3 == 2:
            for j in range(i, n):
                if a[j] % 3 == 1:
                    a[i], a[j] = a[j], a[i]
                    ans += 1
                    ans -= 1
                    break
    print(ans)

